eceive email notifications','','none'),(6989,_binary 'There are two types of actions: simple and advanced. Simple actions do not require any additional configuration and are listed here automatically. Advanced actions need to be created and configured before they can be used because they have options that need to be specified; for example, sending an email to a specified address or unpublishing content containing certain words. To create an advanced action, select the action from the drop-down list in the advanced action section below and click the <em>Create</em> button.','','none'),(6990,_binary 'Send email configuration','','none'),(6991,_binary 'Enter a valid email address or use a token email address such as %author.','','none'),(6992,_binary '<abbr title=\"Outline Processor Markup Language\">OPML</abbr> is an XML format for exchanging feeds between aggregators. A single OPML document may contain many feeds. Aggregator uses this file to import all feeds at once. Upload a file from your computer or enter a URL where the OPML file can be downloaded.','','none'),(6993,_binary 'Aggregator feed block','','none'),(6994,_binary '<em>Either</em> upload a file or enter a URL.','','none'),(6995,_binary 'Show for the listed pages','','none'),(6996,_binary 'Hide for the listed pages','','none'),(6997,_binary 'Duplicate @display_title','','none'),(6998,_binary 'Book navigation block','','none'),(6999,_binary 'Block display mode','','none'),(7000,_binary 'Book outline for @book.title','','none'),(7001,_binary 'Book traversal links for','','none'),(7002,_binary 'The field name from which the comment originated.','','none'),(7003,_binary 'Overriding default settings','','none'),(7004,_binary 'Approving and managing comments','','none'),(7005,_binary 'This page provides a list of all comment types on the site and allows you to manage the fields, form and display settings for each.','','none'),(7006,_binary 'Administer comment types and settings','','none'),(7007,_binary 'Commen