ions page of a content entity gives an overview of the translation status for the current content and lets you add, edit, and delete its translations. This process is similar for every translatable content entity on your site.','','none'),(7026,_binary 'Changing the source language for a translation','','none'),(7027,_binary 'When you add a new translation, the original text you are translating is displayed in the edit form as the <em>source</em>. If at least one translation of the original content already exists when you add a new translation, you can choose either the original content (default) or one of the other translations as the source, using the select list in the Source language section. After saving the translation, the chosen source language is then listed on the Translate tab of the content.','','none'),(7028,_binary 'Setting status of translations','','none'),(7029,_binary 'If you edit a translation in one language you may want to set the status of the other translations as <em>out-of-date</em>. You can set this status by selecting the <em>Flag other translations as outdated</em> checkbox in the Translation section of the content editing form. The status will be visible on the Translations page.','','none'),(7030,_binary 'Managing and displaying date fields','','none'),(7031,_binary 'Displaying dates','','none'),(7032,_binary 'Jan','Abbreviated month name','none'),(7033,_binary 'Feb','Abbreviated month name','none'),(7034,_binary 'Mar','Abbreviated month name','none'),(7035,_binary 'Apr','Abbreviated month name','none'),(7036,_binary 'May','Abbreviated month name','none'),(7037,_binary 'Jun','Abbreviated month name','none'),(7038,_binary 'Jul','Abbreviated month name','none'),(7039,_binary 'Aug','Abbreviated month name','none'),(7040,_binary 'Sep','Abbreviated month name','none'),(7041,_binary 'Oct','Abbreviated month name','none'),(7042,_binary 'Nov','Abbreviated month name','none'),(7043,_binary 'Dec','Abbreviated month name','none'),(7044,_binary 'Su