wing filter formats: %formats','','none'),(7471,_binary 'Log in to post new content in the forum.','','none'),(7472,_binary 'Providing page-specific help','','none'),(7473,_binary 'Effect settings','','none'),(7474,_binary 'Allow to alter the language','','none'),(7475,_binary 'Influence of \'@title\'','','none'),(7476,_binary 'Installing supporting modules','','none'),(7477,_binary 'Default indexing settings','','none'),(7478,_binary '<p>Search pages that use an index may use the default index provided by the Search module, or they may use a different indexing mechanism. These settings are for the default index. <em>Changing these settings will cause the default search index to be rebuilt to reflect the new settings. Searching will continue to work, based on the existing index, but new content won\'t be indexed until all existing content has been re-indexed.</em></p><p><em>The default settings should be appropriate for the majority of sites.</em></p>','','none'),(7479,_binary 'The default search index will be rebuilt.','','none'),(7480,_binary 'This will re-index content in the search indexes of all active search pages. Searching will continue to work, but new content won\'t be indexed until all existing content has been re-indexed. This action cannot be undone.','','none'),(7481,_binary 'All search indexes will be rebuilt.','','none'),(7482,_binary 'Add shortcut link','','none'),(7483,_binary 'Popular content block settings','','none'),(7484,_binary 'Number of day\\s top views to display','','none'),(7485,_binary 'Publish status','','none'),(7486,_binary 'Whether or not the content related to a term is published.','','none'),(7487,_binary 'Major upgrade warning','','none'),(7488,_binary 'This update is a major version update which means that it may not be backwards compatible with your currently running version. It is recommended that you read the release notes and proceed at your own risk.','','none'),(7489,_binary 'User data field','','none'),(7490,_binary 'Only