m>. <em>Content entity types</em> are the entity types for site content (such as the main site content, comments, custom blocks, taxonomy terms, and user accounts). <em>Configuration entity types</em> are used to store configuration information for your site, such as individual views in the Views module, and settings for your main site content types.','','none'),(7516,_binary 'Entity sub-types','','none'),(7517,_binary 'Some content entity types are further grouped into sub-types (for example, you could have article and page content types within the main site content entity type, and tag and category vocabularies within the taxonomy term entity type); other entity types, such as user accounts, do not have sub-types. Programmers use the term <em>bundle</em> for entity sub-types.','','none'),(7518,_binary 'Fields and field types','','none'),(7519,_binary 'Content entity types and sub-types store most of their text, file, and other information in <em>fields</em>. Fields are grouped by <em>field type</em>; field types define what type of data can be stored in that field, such as text, images, or taxonomy term references.','','none'),(7520,_binary 'Formatters and view modes','','none'),(7521,_binary 'Content entity types and sub-types can have one or more <em>view modes</em>, used for displaying the entity items. For instance, a content item could be viewed in full content mode on its own page, teaser mode in a list, or RSS mode in a feed. In each view mode, each field can be hidden or displayed, and if it is displayed, you can choose and configure the <em>formatter</em> that is used to display the field. For instance, a long text field can be displayed trimmed or full-length, and taxonomy term reference fields can be displayed in plain text or linked to the taxonomy term page.','','none'),(7522,_binary 'Widgets and form modes','','none'),(7523,_binary 'Content entity types and sub-types can have one or more <em>form modes</em>, used for editing. For instance, a content item could be edited in a compact format with only some fields editable, or a full format that allows all fields to be edited. In each form mode, each field can be hidden or displayed, and if it is displayed, you can choose and configure the <em>widget</em> that is used to edit the field. For instance, a taxonomy term reference field can be edited using a select list, radio buttons, or an autocomplete widget.','','none'),(7524,_binary 'Enabling field types, widgets, and formatters','','none'),(7525,_binary 'Views entity field handler','','none'),(7526,_binary 'Creating a field','','none'),(7527,_binary 'On the <em>Manage fields</em> page for your entity type or sub-type, you can add, configure, and delete fields for that entity type or sub-type. Each field has a <em>machine name</em>, which is used internally to identify the field and must be unique across an entity type; once a field is created, you cannot change the machine name. Most fields have two types of settings. The field-level settings depend on the field type, and affect how the data in the field is stored. Once they are set, they can no longer be changed; examples include how many data values are allowed for the field and where files are stored. The sub-type-level settings are specific to each entity sub-type the field is used on, and they can be changed later; examples include the field label, help text, default value, and whether the field is required or not. You can return to these settings by choosing the <em>Edit</em> link for the field from the <em>Manage fields</em> page.','','none'),(7528,_binary 'Re-using fields','','none'),(7529,_binary 'Once you have created a field, you can use it again in other sub-types of the same entity type. For instance, if you create a field for the article content type, you can also use it for the page content type, but you cannot use it for custom blocks or taxonomy terms. If there are fields available for re-use, after clicking <em>Add field</em> from the <em>Manage fields</em> page, you will see a list of available fields for re-use. After selecting a field for re-use, you can configure the sub-type-level settings.','','none'),(7530,_binary 'Configuring field editing','','none'),(7531,_binary 'On the <em>Manage form display</em> page of your entity type or sub-type, you can configure how the field data is edited by default and in each form mode. If your entity type has multiple form modes (on most sites, most entities do not), you can toggle between the form modes at the top of the page, and you can toggle whether each form mode uses the default settings or custom settings in the <em>Custom display settings</em> section. For each field in each form mode, you can select the widget to use for editing; some widgets have additional configuration options, such as the size for a text field, and these can be edited using the Edit button (which looks like a wheel). You can also change the order of the fields on the form. You can exclude a field from a form by choosing <em>Hidden</em> from the widget drop-down list, or by dragging it into the <em>Disabled</em> section.','','none'),(7532,_binary 'Configuring field display','','none'),(7533,_binary 'On the <em>Manage display</em> page of your entity type or sub-type, you can configure how each field is displayed by default and in each view mode. If your entity type has multiple view modes, you can toggle between the view modes at the top of the page, and you can toggle whether each view mode uses the default settings or custom settings in the <em>Custom display settings</em> section. For each field in each view mode, you can choose whether and how to display the label of the field from the <em>Label</em> drop-down list. You can also select the formatter to use for display; some formatters have configuration options, which you can edit using the Edit button (which looks like a wheel). You can also change the display order of fields. You can exclude a field from a specific view mode by choosing <em>Hidden</em> from the formatter drop-down list, or by dragging it into the <em>Disabled</em> section.','','none'),(7534,_binary 'Configuring view and form modes','','none'),(7535,_binary 'Listing fields','','none'),(7536,_binary 'Images must be exactly <strong>@size</strong> pixels.','','none'),(7537,_binary 'Images must be larger than <strong>@min</strong> pixels. Images larger than <strong>@max</strong> pixels will be resized.','','none'),(7538,_binary 'Images must be larger than <strong>@min</strong> pixels.','','none'),(7539,_binary 'Images larger than <strong>@max</strong> pixels will be resized.','','none'),(7540,_binary 'Forum leaf','Validation','none'),(7541,_binary 'The menu link language code.','','none'),(7542,_binary 'Node authored by (uid)','','none'),(7543,_binary 'Revision authored by (uid)','','none'),(7544,_binary 'Content access view grants','','none'),(7545,_binary 'The location this shortcut points to.','','none'),(7546,_binary 'Unable to install @extension, %config_names already exists in active configuration.Unable to install @extension, %config_names already exist in active configuration.','','none'),(7547,_binary 'No access to execute %action on the @entity_type_label %entity_label.','','none'),(7548,_binary 'narrow','','none'),(7549,_binary 'The reference view %view_name cannot be found.','','none'),(7550,_binary 'Enabled','Plural','none'),(7551,_binary 'Active menu trail','','none'),(7552,_binary 'Configuration updates','','none'),(7553,_binary 'The listed configuration will be updated.','','none'),(7554,_binary 'An entity field containing a password value.','','none'),(7555,_binary 'An autocomplete text field with tagging support.','','none'),(7556,_binary 'The feed %label has been deleted.','','none'),(7557,_binary 'Block Content revision is a history of changes to block content.','','none'),(7558,_binary 'Get the actual block content from a block content revision.','','none'),(7559,_binary 'The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. If you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if you haven\'t changed the colors</em>. This step is required because the module stylesheets in the files directory need to be recreated to reflect your changes.','','none'),(7560,_binary 'Responsive image style %label saved.','','none'),(7561,_binary 'Field, widget, and formatter information','','none'),(7562,_binary 'Provided by modules','','none'),(7563,_binary 'Here is a list of the currently enabled field, formatter, and widget modules:','','none'),(7564,_binary 'Provided by Drupal core','','none'),(7565,_binary 'As mentioned previously, some field types, widgets, and formatters are provided by Drupal core. Here are some notes on how to use some of these:','','none'),(7566,_binary '<strong>Number fields</strong>: When you add a number field you can choose from three types: <em>decimal</em>, <em>float</em>, and <em>integer</em>. The <em>decimal</em> number field type allows users to enter exact decimal values, with fixed numbers of decimal places. The <em>float</em> number field type allows users to enter approximate decimal values. The <em>integer</em> number field type allows users to enter whole numbers, such as years (for example, 2012) or values (for example, 1, 2, 5, 305). It does not allow decimals.','','none'),(7567,_binary 'Defining image styles','','none'),(7568,_binary 'Naming image styles','','none'),(7569,_binary 'When you define an image style, you will need to choose a displayed name and a machine name. The displayed name is shown in administrative pages, and the machine name is used to generate the URL for accessing an image processed in that style. There are two common approaches to naming image styles: either based on the effects being applied (for example, <em>Square 85x85</em>), or based on where you plan to use it (for example, <em>Profile picture</em>).','','none'),(7570,_binary 'Configuring image fields','','none'),(7571,_binary 'A few of the settings for image fields are defined once when you create the field and cannot be changed later; these include the choice of public or private file storage and the number of images that can be stored in the field. The rest of the settings can be edited later; these settings include the field label, help text, allowed file extensions, image resolution restrictions, and the subdirectory in the public or private file storage where the images will be stored. The editable settings can also have different values for different entity sub-types; for instance, if your image field is used on both Page and Article content types, you can store the files in a different subdirectory for the two content types.','','none'),(7572,_binary 'The maximum file size that can be uploaded is limited by PHP settings of the server, but you can restrict it further by configuring a <em>Maximum upload size</em> in the field settings (this setting can be changed later). The maximum file size, either from PHP server settings or field configuration, is automatically displayed to users in the help text of the image field.','','none'),(7573,_binary 'You can also configure a default image that will be used if no image is uploaded in an image field. This default can be defined for all instances of the field in the field storage settings when you create a field, and the setting can be overridden for each entity sub-type that uses the field.','','none'),(7574,_binary 'Configuring displays and form displays','','none'),(7575,_binary 'On the <em>Manage display</em> page, you can choose the image formatter, which determines the image style used to display the image in each display mode and whether or not to display the image as a link. On the <em>Manage form display</em> page, you can configure the image upload widget, including setting the preview image style shown on the entity edit form.','','none'),(7576,_binary 'Selected language configuration','','none'),(7577,_binary 'Selected default language no longer exists.','','none'),(7578,_binary 'Language detection configuration saved.','','none'),(7579,_binary 'Language codes or other custom text to use as a path prefix for URL language detection. For the selected fallback language, this value may be left blank. <strong>Modifying this value may break existing URLs. Use with caution in a production environment.</strong> Example: Specifying \"deutsch\" as the path prefix code for German results in URLs like \"example.com/deutsch/contact\".','','none'),(7580,_binary 'Manually entered paths should start with /, ? or #.','','none'),(7581,_binary 'Start typing the title of a piece of content to select it. You can also enter an internal path such as %add-node or an external URL such as %url. Enter %front to link to the front page.','','none'),(7582,_binary 'Link URI can be accessed by the user.','Validation','none'),(7583,_binary 'The path \'@uri\' is inaccessible.','','none'),(7584,_binary 'The path \'@uri\' is invalid.','','none'),(7585,_binary 'The location this menu link points to.','','none'),(7586,_binary '@title [%language translation]','','none'),(7587,_binary 'The username of the content author.','','none'),(7588,_binary 'Defining responsive image styles','','none'),(7589,_binary 'Using responsive image styles in Image fields','','none'),(7590,_binary 'A responsive image style associates an image style with each breakpoint defined by your theme.','','none'),(7591,_binary 'Responsive image styles','','none'),(7592,_binary 'Edit responsive image style','','none'),(7593,_binary 'Duplicate responsive image style','','none'),(7594,_binary 'Add responsive image style','','none'),(7595,_binary 'Responsive image style','','none'),(7596,_binary 'Image style mappings','','none'),(7597,_binary 'Image style mapping','','none'),(7598,_binary 'Responsive image mapping type','','none'),(7599,_binary 'Sizes attribute','','none'),(7600,_binary 'Image styles to be used when using the \'sizes\' attribute','','none'),(7601,_binary '<em>Duplicate responsive image style</em> @label','','none'),(7602,_binary '<em>Edit responsive image style</em> @label','','none'),(7603,_binary 'Responsive image style @label saved.','','none'),(7604,_binary 'Responsive image style: @responsive_image_style','','none'),(7605,_binary 'Select a responsive image style.','','none'),(7606,_binary 'The default drag-and-drop user interface for ordering tables in the administrative interface presents a challenge for some users, including users of screen readers and other assistive technology. The drag-and-drop interface can be disabled in a table by clicking a link labeled \"Show row weights\" above the table. The replacement interface allows users to order the table by choosing numerical weights instead of dragging table rows.','','none'),(7607,_binary 'Using maintenance mode','','none'),(7608,_binary 'Configuring the file system','','none'),(7609,_binary 'Configuring the image toolkit','','none'),(7610,_binary 'Are you sure you want to delete the format %name : %format?','','none'),(7611,_binary 'Managing vocabularies','','none'),(7612,_binary 'Managing terms','','none'),(7613,_binary 'Classifying entity content','','none'),(7614,_binary 'Adding new terms during content creation','','none'),(7615,_binary 'User email required','Validation','none'),(7616,_binary 'The target entity','','none'),(7617,_binary 'Append a destination query string to operation links.','','none'),(7618,_binary 'Provides links to perform entity operations.','','none'),(7619,_binary 'Content language of view row','','none'),(7620,_binary 'Original language of content in view row','','none'),(7621,_binary '@entity_type_label ID','','none'),(7622,_binary 'Rendering Language','','none'),(7623,_binary 'All content that supports translations will be displayed in the selected language.','','none'),(7624,_binary 'The contextual filter values are provided by the URL.','','none'),(7625,_binary 'The following replacement tokens are available for this field. Note that due to rendering order, you cannot use fields that come after this field; if you need a field not listed here, rearrange your fields.','','none'),(7626,_binary '@label (@id)','','none'),(7627,_binary 'Entity reference field storage settings','','none'),(7628,_binary 'Entity reference field settings','','none'),(7629,_binary 'Entity reference selection plugin settings','','none'),(7630,_binary 'Display in native language','','none'),(7631,_binary 'HTTP cookies','','none'),(7632,_binary 'HTTP headers','','none'),(7633,_binary 'Is super user','','none'),(7634,_binary 'Query arguments','','none'),(7635,_binary 'Request format','','none'),(7636,_binary 'Field settings (@on_label / @off_label)','','none'),(7637,_binary '@on_label / @off_label','','none'),(7638,_binary 'Displayed in native language','','none'),(7639,_binary 'Submitted by @username on @datetime','','none'),(7640,_binary 'By @author @time ago','','none'),(7641,_binary 'With multiple languages configured, registered users can select their preferred language and authors can assign a specific language to content.','','none'),(7642,_binary 'This page also provides an overview of how much of the site\'s interface has been translated for each configured language.','','none'),(7643,_binary 'If the Interface Translation module is enabled, this page will provide an overview of how much of the site\'s interface has been translated for each configured language.','','none'),(7644,_binary 'Depending on your site features, additional modules that you might want to enable are:','','none'),(7645,_binary 'This must be an external URL such as %url.','','none'),(7646,_binary 'No dangerous external protocols','Validation','none'),(7647,_binary 'No broken internal links','Validation','none'),(7648,_binary 'Submitted by @author_name on @date','','none'),(7649,_binary 'Search looks for exact, case-insensitive keywords; keywords shorter than a minimum length are ignored.','','none'),(7650,_binary 'Use upper-case OR to get more results. Example: cat OR dog (content contains either \"cat\" or \"dog\").','','none'),(7651,_binary 'You can use upper-case AND to require all words, but this is the same as the default behavior. Example: cat AND dog (same as cat dog, content must contain both \"cat\" and \"dog\").','','none'),(7652,_binary 'Use quotes to search for a phrase. Example: \"the cat eats mice\".','','none'),(7653,_binary 'You can precede keywords by - to exclude them; you must still have at least one \"positive\" keyword. Example: cat -dog (content must contain cat and cannot contain dog).','','none'),(7654,_binary 'The testing framework requires the %sites-simpletest directory to exist and be writable in order to run tests.','','none'),(7655,_binary 'The file %file does not exist and could not be created automatically, which poses a security risk. Ensure that the directory is writable.','','none'),(7656,_binary 'User is admin','','none'),(7657,_binary 'Include the anonymous user in the matched entities.','','none'),(7658,_binary 'Include the anonymous user.','','none'),(7659,_binary 'User search looks for user names and partial user names. Example: mar would match usernames mar, delmar, and maryjane.','','none'),(7660,_binary 'You can use * as a wildcard within your keyword. Example: m*r would match user names mar, delmar, and elementary.','','none'),(7661,_binary 'No eligible views were found.','','none'),(7662,_binary 'The view is not based on a translatable entity type or the site is not multilingual.','','none'),(7663,_binary 'Display \"@display\" uses a \"more\" link but there are no displays it can link to. You need to specify a custom URL.','','none'),(7664,_binary 'Disabling SQL rewriting will omit all query tags, i. e. disable node access checks as well as override hook_query_alter() implementations in other modules.','','none'),(7665,_binary 'Testing config overrides','','none'),(7666,_binary 'Minimal profile for running tests with config overrides in a profile.','','none'),(7667,_binary 'Account\'s permissions','','none'),(7668,_binary 'The hashed password','','none'),(7669,_binary 'Existing password','','none'),(7670,_binary 'Filter output for aggregator items','','none'),(7671,_binary 'Display the author name.','','none'),(7672,_binary 'Are you sure you want to create a new %name @type?','','none'),(7673,_binary 'Using the personal contact form','','none'),(7674,_binary 'Site visitors can email registered users on your site by using the personal contact form, without knowing or learning the email address of the recipient. When a site visitor is viewing a user profile, the viewer will see a <em>Contact</em> tab or link, which leads to the personal contact form. The personal contact link is not shown when you are viewing your own profile, and users must have both <em>View user information</em> (to see user profiles) and <em>Use users\' personal contact forms</em> permission to see the link. The user whose profile is being viewed must also have their personal contact form enabled (this is a user account setting); viewers with <em>Administer users</em> permission can bypass this setting.','','none'),(7675,_binary 'Configuring contact forms','','none'),(7676,_binary 'Linking to contact forms','','none'),(7677,_binary 'Adding content to contact forms','','none'),(7678,_binary '@entity using @field_name','','none'),(7679,_binary 'Relate each @entity with a @field_name set to the @label.','','none'),(7680,_binary 'Configuring form displays','','none'),(7681,_binary 'Reference fields have several widgets available on the <em>Manage form display</em> page:','','none'),(7682,_binary 'The <em>Check boxes/radio buttons</em> widget displays the existing entities for the entity type as check boxes or radio buttons based on the <em>Allowed number of values</em> set for the field.','','none'),(7683,_binary 'The <em>Select list</em> widget displays the existing entities in a drop-down list or scrolling list box based on the <em>Allowed number of values</em> setting for the field.','','none'),(7684,_binary 'The <em>Autocomplete</em> widget displays text fields in which users can type entity labels based on the <em>Allowed number of values</em>. The widget can be configured to display all entities that contain the typed characters or restricted to those starting with those characters.','','none'),(7685,_binary 'The <em>Autocomplete (Tags style)</em> widget displays a multi-text field in which users can type in a comma-separated list of entity labels.','','none'),(7686,_binary 'Your server is not capable of displaying file upload progress. File upload progress requires an Apache server running PHP with mod_php or Nginx with PHP-FPM.','','none'),(7687,_binary 'Your server is not capable of displaying file upload progress. File upload progress requires PHP be run with mod_php or PHP-FPM and not as FastCGI.','','none'),(7688,_binary 'Display download path','','none'),(7689,_binary 'Display the filemime as icon','','none'),(7690,_binary 'Detect tar','','none'),(7691,_binary 'Link this field to the file download URL','','none'),(7692,_binary 'File link','','none'),(7693,_binary 'Include tar in extension','','none'),(7694,_binary 'If the part of the filename just before the extension is \'.tar\', include this in the extension output.','','none'),(7695,_binary 'Display the file download URI','','none'),(7696,_binary 'Display an icon','','none'),(7697,_binary 'The icon is representing the file type, instead of the MIME text (such as \"image/jpeg\")','','none'),(7698,_binary 'Using text fields with text formats','','none'),(7699,_binary 'Text fields that allow text formats are those with \"formatted\" in the description. These are <em>Text (formatted, long, with summary)</em>, <em>Text (formatted)</em>, and <em>Text (formatted, long)</em>. You cannot change the type of field once a field has been created.','','none'),(7700,_binary 'Setting the allowed link type','','none'),(7701,_binary 'In the field settings you can define the allowed link type to be <em>internal links only</em>, <em>external links only</em>, or <em>both internal and external links</em>. <em>Internal links only</em> and <em>both internal and external links</em> options enable an autocomplete widget for internal links, so a user does not have to copy or remember a URL.','','none'),(7702,_binary 'Revisions allow you to track differences between multiple versions of your content, and revert to older versions.','','none'),(7703,_binary '@type %title has been reverted to the revision from %revision-date.','','none'),(7704,_binary 'Speeding up your site','','none'),(7705,_binary 'The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a grey or yellow star. If you click on the grey star, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a yellow star, and will allow you to remove the current page from your shortcut set.','','none'),(7706,_binary 'PHP (multiple statement disabling)','','none'),(7707,_binary 'PHP versions higher than 5.6.5 or 5.5.21 provide built-in SQL injection protection for mysql databases. It is recommended to update.','','none'),(7708,_binary 'Site default language code','','none'),(7709,_binary 'Page caching','','none'),(7710,_binary 'Please log in to access this page.','','none'),(7711,_binary 'Allowing users to add new terms gradually builds a vocabulary as content is added and edited. Users can add new terms if either of the two <em>Autocomplete</em> widgets is chosen for the Taxonomy term reference field in the <em>Manage form display</em> page for the field. You will also need to enable the <em>Create referenced entities if they don\'t already exist</em> option, and restrict the field to one vocabulary.','','none'),(7712,_binary 'If you choose <em>Text (plain)</em> or <em>Text (formatted)</em> as the field type on the <em>Manage fields</em> page, then a field with a single row is displayed. You can change the maximum text length in the <em>Field settings</em> when you set up the field.','','none'),(7713,_binary 'If you choose <em>Text (plain, long)</em>, <em>Text (formatted, long)</em>, or <em>Text (formatted, long, with summary)</em> on the <em>Manage fields</em> page, then users can insert text of unlimited length. On the <em>Manage form display</em> page, you can set the number of rows that are displayed to users.','','none'),(7714,_binary 'As an alternative to using a trimmed version of the text, you can enter a separate summary by choosing the <em>Text (formatted, long, with summary)</em> field type on the <em>Manage fields</em> page. Even when <em>Summary input</em> is enabled, and summaries are provided, you can display <em>trimmed</em> text nonetheless by choosing the appropriate format on the <em>Manage display</em> page.','','none'),(7715,_binary 'The Update Manager also allows administrators to update and install modules and themes through the administration interface.','','none'),(7716,_binary 'Performing updates through the Update page','','none'),(7717,_binary 'Installing new modules and themes through the Install page','','none'),(7718,_binary 'Link to the user','','none'),(7719,_binary 'Display the user or author name.','','none'),(7720,_binary 'Password required for protected field change','Validation','none'),(7721,_binary 'Text to use for this variant, @count will be replaced with the value.','','none'),(7722,_binary 'Text to use for the singular form, @count will be replaced with the value.','','none'),(7723,_binary 'Testing multilingual with English','','none'),(7724,_binary 'Contains US ASCII characters only','','n