ter import.','','none'),(7743,_binary 'Configuration %name depends on the %config configuration that will not exist after import.Configuration %name depends on configuration (%config) that will not exist after import.','','none'),(7744,_binary 'NotNull','Validation','none'),(7745,_binary 'Null','Validation','none'),(7746,_binary 'Aggregator title','','none'),(7747,_binary 'Formats an aggregator item or feed title with an optional link.','','none'),(7748,_binary 'Empty block library behavior','','none'),(7749,_binary 'Provides a link to add a new block.','','none'),(7750,_binary 'Books have a hierarchical structure, called a <em>book outline</em>. Each book outline can have nested pages up to nine levels deep. Multiple content types can be configured to behave as a book outline. From the content edit form, it is possible to add a page to a book outline or create a new book.','','none'),(7751,_binary 'Configuring content types for books','','none'),(7752,_binary 'Content type for the <em>Add child page</em> link','','none'),(7753,_binary 'The configuration cannot be imported because it failed validation for the following reasons:','','none'),(7754,_binary 'Link to translate @entity_type_label','','none'),(7755,_binary 'Provide a translation link to the @entity_type_label.','','none'),(7756,_binary 'The Forum module lets you create threaded discussion forums with functionality similar to other message board systems. In a forum, users post topics and threads in nested hierarchies, allowing discussions to be categorized and grouped.','','none'),(7757,_binary 'A forum is represented by a hierarchical structure, consisting of:','','none'),(7758,_binary '<em>Forums</em> (for example, <em>Recipes for cooking vegetables</em>)','','none'),(7759,_binary '<em>Forum topics</em> submitted by users (for example, <em>How to cook potatoes</em>), which start discussions.','','none'),(7760,_binary 'Threaded <em>comments</em> submitted by users (for example, <em>You wash the potatoes first and then...</em>).','','none'),(7761,_binary 'Optional <em>containers</em>, used to group similar forums. Forums can be placed inside containers, and vice versa.','','none'),(7762,_binary 'Setting up the forum structure','','none'),(7763,_binary 'Navigating in the forum','','none'),(7764,_binary 'The domain for %language may only contain the domain name, not a trailing slash, protocol and/or port.','','none'),(7765,_binary '@language translation of the @type %label has been deleted.','','none'),(7766,_binary 'always_populate_raw_post_data PHP setting','','none'),(7767,_binary 'Not set to -1.','','none'),(7768,_binary 'Domain of the relation','','none'),(7769,_binary 'Xdebug settings','','none'),(7770,_binary 'xdebug.max_nesting_level is set to %value.','','none'),(7771,_binary 'Set <code>xdebug.max_nesting_level=@level</code> in your PHP configuration as some pages in your Drupal site will not work when this setting is too low.','','none'),(7772,_binary 'For more detailed information, see the <a href=\"https://www.drupal.org/upgrade\">upgrading handbook</a>. If you are unsure what these terms mean you should probably contact your hosting provider.','','none'),(7773,_binary 'Trimmed limit','','none'),(7774,_binary 'If the summary is not set, the trimmed %label field will end at the last full sentence before this character limit.','','none'),(7775,_binary 'Trimmed limit: @trim_length characters','','none'),(7776,_binary '%name is blocked or has not been activated yet.','','none'),(7777,_binary 'Working with multilingual views','','none'),(7778,_binary 'If your site has multiple languages and translated entities, each result row in a view will contain one translation of each involved entity (a view can involve multiple entities if it uses relationships). You can use a filter to restrict your view to one language: without filtering, if an entity has three translations it will add three rows to the results; if you filter by language, at most one result will appear (it could be zero if that particular entity does not have a translation matching your language filter choice). If a view uses relationships, each entity in the relationship needs to be filtered separately. You can filter a view to a fixed language choice, such as English or Spanish, or to the language selected by the page the view is displayed on (the language that is selected for the page by the language detection settings either for Content or User interface).','','none'),(7779,_binary 'Because each result row contains a specific translation of each entity, field-level filters are also relative to these entity translations. For example, if your view has a filter that specifies that the entity title should contain a particular English word, you will presumably filter out all rows containing Chinese translations, since they will not contain the English word. If your view also has a second filter specifying that the title should contain a particular Chinese word, and if you are using \"And\" logic for filtering, you will presumably end up with no results in the view, because there are probably not any entity translations containing both the English and Chinese words in the title.','','none'),(7780,_binary 'Independent of filtering, you can choose the display language (the language used to display the entities and their fields) via a setting on the display. Your language choices are the same as the filter language choices, with an additional choice of \"Content language of view row\" and \"Original language of content in view row\", which means to display each entity in the result row using the language that entity has or in which it was originally created. In theory, this would give you the flexibility to filter to French translations, for instance, and then display the results in Spanish. The more usual choices would be to use the same language choices for the display language and each entity filter in the view, or to use the Row language setting for the display.',''