wport is larger than 40em (typically 640px), you could enter \"(min-width: 40em) 40vw, 90vw\" in the Sizes field. The last item in the comma-separated list is the smallest viewport size: other items in the comma-separated list should have a media condition paired with an image width. <em>Media conditions</em> are similar to a media query, often a min-width paired with a viewport width using em or px units: e.g. (min-width: 640px) or (min-width: 40em). This is paired with the <em>image width</em> at that viewport size using px, em or vw units. The vw unit is viewport width and is used instead of a percentage because the percentage always refers to the width of the entire viewport.','','none'),(8986,_binary 'These are the supported authentication providers for this view. When this view is requested, the client will be forced to authenticate with one of the selected providers. Make sure you set the appropriate requirements at the <em>Access</em> section since the Authentication System will fallback to the anonymous user if it fails to authenticate. For example: require Access: Role | Authenticated User.','','none'),(8987,_binary 'Serialization settings','','none'),(8988,_binary 'The testing framework requires the <a href=\"https://secure.php.net/manual/en/curl.setup.php\">PHP cURL library</a>. For more information, see the <a href=\"https://www.drupal.org/requirements/php/curl\">online information on installing the PHP cURL extension</a>.','','none'),(8989,_binary 'Tried to generate 10 random bytes, generated @count','','none'),(8990,_binary 'Drupal is unable to generate highly randomized numbers, which means certain security features like password reset URLs are not as secure as they should be. Instead, only a slow, less-secure fallback generator is available. The most likely cause is that open_basedir restrictions are in effect and /dev/urandom is not on the whitelist. See the <a href=\":drupal-php\">system requirements</a> page for more information. %exception_messa