os usuarios no identificados, que no son de confianza, deberÃ­an solo tener acceso a formatos de texto y restringirlos a texto sin formato o un conjunto seguro de etiquetas HTML. Eso es debido a que las etiquetas HTML pueden permitir enlazar a sistio maliciosos o scripts en texto. Los usuarios registrados mÃ¡s confiable se le puede conceder permisos para usar formatos de texto menos restrictivos para crear texto mÃ¡s rico. <strong>La inadecuada configuraciÃ³n de formatos de textos es un riesgo de seguridad.</strong>','es',1),(8421,_binary 'Cada formato de texto utiliza filtros que aÃ±aden, eliminan o transforman elementos dentro del texto introducido por el usuario. Por ejemplo: un filtro elimina etiquetas HTML no aprobadas, mientras que otro transforma URLs en enlaces sobre los que se pueden hacer clic. Los filtros son aplicados en un orden especÃ­fico. No cambian el contenido <em>almacenado</em>, definen como se procesan y muestran en pantalla.','es',1),(8422,_binary 'Los formatos de texto definen como se filtran el texto a la salida y como las etiquetas HTML y otros texto se muestran, reemplazar o eliminan. <strong>La inadecuada configuraciÃ³n de formatos de textos es un riesgo de seguridad</strong>. Para saber mÃ¡s, consulte la <a href=\":filter_help\">pÃ¡gina de ayuda del mÃ³dulo Filter</a>.','es',1),(8423,_binary 'Un formato de texto contiene filtros que cambian la visualizaciÃ³n de la entrada del usuario, por ejemplo: eliminando parte HTML maliciosas o haciendo que se pueda hacer clic sobre las URLs.Los filtros son ejecutados de arriba a abajo el orden es importante, dado que un filtro puede prevenir que otro filtro cumpla con su funciÃ³n. Por ejemplo: cuando las URLS se convierten en enlaces antes de borrar etiquetas HTML no permitidas, todas esos enlaces se borrarÃ¡n. Cuando esto pasa el orden de los filtros podrÃ­a necesitar ser reordenado.','es',1),(8424,_binary 'Configura cÃ³mo se filtra el contenido cuando se muestra en pantalla, incluyendo quÃ© etiquet